const ScreenOne = (props) => {
    console.log(props.nameItem.show.image.medium)
    return (
        <div className="section_col" key={props.nameItem}>
            <img src={props.nameItem.show.image.medium} alt="" />
            <h1>{props.nameItem.show.name}</h1>
        </div>
    )
}

export default ScreenOne
